import React from 'react';

import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';

import LandingLogo from '../img/landingLogo.png';

import '../css/Footer.css';

const Landing = () => {
	return (
		<footer
			style={{
				padding: '2rem 0',
				background: '#2A2A2A',
			}}
			className="text-center"
		>
			<Container fluid>
				<Row className="justify-content-center align-items-center">
					<Col xs={4} className="text-left">
						<img src={LandingLogo} alt="landing logo" style={style.Logo} />
					</Col>
					<Col xs={6}>
						<a href="http://webatberkeley.org/">
							<p
								style={{
									margin: '0',
									padding: '.7rem',
									fontSize: '18px',
								}}
							>
								This Site was Designed and Built by Web Development at Berkeley
							</p>
						</a>
					</Col>
				</Row>
				<Row className="justify-content-center align-items-center">
					<Col xs={4} className="text-left">
						<p style={style.DisclaimerText}>
							We are a student group acting independently of the University of
							California. We take full responsibility for our organization and
							this web site.
						</p>
					</Col>
					<Col xs={6}>
						<img
							className="aligncenter size-full"
							style={style.OCF}
							src="https://www.ocf.berkeley.edu/hosting-logos/ocf-hosted-penguin-dark.svg"
							alt="hosted by the ocf"
						></img>
					</Col>
				</Row>
				<Row>
					<Col xs={12} className="social-row">
						<a href="https://www.facebook.com/formulaelectricberkeley/">
							<i class="fa fa-facebook"></i>
						</a>

						<a
							href="https://twitter.com/cal_electric"
							class="fa fa-twitter"
						></a>
						<a
							href="https://www.instagram.com/berkeleyformulaelectric/"
							class="fa fa-instagram"
						></a>
						<a
							href="https://www.linkedin.com/company/formulaelectricberkeley/"
							class="fa fa-linkedin"
						></a>
						<a
							href="https://www.youtube.com/channel/UCvDIeMEXHI4r0uX0OfNizZw"
							class="fa fa-youtube"
						></a>
						<a
							href="mailto:berkeleyformulae@gmail.com"
							class="fa fa-google"
						></a>
					</Col>
				</Row>
			</Container>
		</footer>
	);
};

const style = {
	Logo: {
		maxWidth: '60%',
	},
	DisclaimerText: {
		padding: '1rem 0',
		fontSize: '16px',
	},
	OCF: {
		width: '125',
		height: '50',
	},
};

export default Landing;
